import React from 'react';
import {Tweet} from "../Types"

type Props = {
  tweet : Tweet
}

const TweetItem: React.FC<Props> = ({tweet}) => {
  return (
    <li>
       <label>
          <span>{tweet.title}</span>
       </label>
       <button>Delete</button>
    </li>
  )
}

export default TweetItem;
